import "./App.css";
import { AuthProvider } from "./context/AuthContext";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./pages/home";
import Login from "./pages/user/login";
import Signup from "./pages/user/signup";
import Navbar from "./components/nav/navbar";
import Logout from "./pages/user/logout";
import Cook from "./pages/communities/cook";
import Workout from "./pages/communities/workout";
import MartialArts from "./pages/communities/MartialArts";
import VoiceLessons from "./pages/communities/VoiceLessons";
import Coding from "./pages/communities/coding";
import Post from "./pages/communities/posts";
import CreatePost from "./pages/CreatePost";
import Practice from "./pages/practice";
import PrivateRoute from "./utils/PrivateRoute";

function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
          <Navbar />
          <Switch>
            <PrivateRoute exact path="/" component={Home}></PrivateRoute>
            <PrivateRoute exact path="/Home" component={Home}></PrivateRoute>
            <Route exact path="/login" component={Login}></Route>
            <Route exact path="/signup" component={Signup}></Route>
            <Route exact path="/logout" component={Logout}></Route>
            <Route exact path="/posts/:id" component={Post} />
            <PrivateRoute exact path="/createpost" component={CreatePost} />
            <Route exact path="practice" component={Practice} />

            <PrivateRoute exact path="/cook" component={Cook} />
            <PrivateRoute exact path="/workout" component={Workout} />
            <PrivateRoute exact path="/Martial Arts" component={MartialArts} />
            <PrivateRoute
              exact
              path="/Voice Lessons"
              component={VoiceLessons}
            />
            <PrivateRoute exact path="/coding" component={Coding} />
          </Switch>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
